import React from 'react';
import Nav from "./Nav";
import axios from 'axios';


const Home = (props) => {





  const response = axios.get('http://localhost:8080/hospitalApp/hospital') // GET meth
  console.log(response.data);


  return (
    <div>
      <div>
        <Nav user1={props.user} />
      </div>

      <div className="card text-body mb-3 w-25 h-100     m-4  bg-white">
        <div className="card-header"><h3>RUSH HOSPITALS</h3></div>
        <div className="card-body">
          <h5 className="card-title">beds occupied:</h5>
          <h5 className="card-title">total beds :</h5>
          <p className="card-text">

          </p>
        </div>
      </div>


    </div>
  )


}

export default Home;
